STATE quarters have not been minted in nearly 15 years, but there some ones that could be quite valuable.
From 1999 to 2008, the US Mint struck state-specific quarters.&nbsp;
All 50 state coins featured George Washington&nbsp;on the obverse, with a design unique to each state on the inverse. Each year, the coins were released into five groups in order of birthdays until the series was complete nearly a decade later.

